import React, {useEffect} from 'react';
import Nav from '../Components/Nav/Nav';

function Home() {
    useEffect(() => {
        fetch("/api/lifetimestats")

            .then(res => res.json())
            .then(result => {
                console.log(result.data.username);
        })
    })
    return (
        <>
        <Nav />
        <div className="container">
            <h1>Home Page</h1>
        </div>
        </>
    )
}

export default Home;
